import Col from 'react-bootstrap/Col';
import Container from 'react-bootstrap/Container';
import Image from 'react-bootstrap/Image';
import Row from 'react-bootstrap/Row';
import me from '../Assets/image.png'

const About = () => {
  return (
    <Container className="my-5 mx-3">
      <Row>
        <Col xs={12} md={4}>
          <Image src={me} alt="Responsive image" roundedCircle fluid />
        </Col>
        <Col xs={12} md={8}>  
          <h2>About Me</h2> 
          <p>
            Hi ! I'm Jade. I'm a student at EPFL, currently finishing a master degree in neurotechnology.
            I'm highly interested in assistive technology. 
          </p>  
        </Col>
      </Row>
    </Container>
  );
}

export default About;
